        void UpdateTool()
        {
            try
            {
                string version = Web.DownloadString("http://rtm.x10host.com/version");
                if (version != currentversion && !string.IsNullOrWhiteSpace(version) && !version.Contains("404") && !version.ToLower().Contains("suspended"))
                {
                    if (MessageBox.Show("An Update is available, would you like to download it?\nFeel free to use the tool while it updates\n\nChanges:\n\n" + Web.DownloadString("http://rtm.x10host.com/changelog"), "Update available", MessageBoxButtons.YesNo, MessageBoxIcon.Information) == DialogResult.Yes)
                    {
                        Invoke((Action)(() => { StatusLabel.Text = "Downloading update..."; }));
                        Web.DownloadFile(Web.DownloadString("http://rtm.x10host.com/download"), "Temp.exe");
                        File.WriteAllBytes(new Uri(Path.GetDirectoryName(Assembly.GetExecutingAssembly().GetName().CodeBase) + "\\Updater.exe").LocalPath, Resources.Updater);
                        Invoke((Action)(() => { Clipboard.SetText(AppDomain.CurrentDomain.FriendlyName); }));
                        Process.Start("Updater.exe");
                        Invoke((Action)(() => { Close(); }));
                    }
                }
            }
            catch (WebException)
            {
                Invoke((Action)(() => { StatusLabel.Text = "A network error has occured, could not find update data"; }));
            }
            catch (Exception)
            {
                Invoke((Action)(() => { StatusLabel.Text = "An error has occured downloading update"; }));
            }
        }

