        private void TMAPI_Click(object sender, EventArgs e)
        {
            AntiBan();
            PS3.ChangeAPI(SelectAPI.TargetManager);
            try
            {
                if (PS3.ConnectTarget())
                {
                    if (PS3.AttachProcess())
                    {
                        CCAPI.BaseColor = Color.FromArgb(192, 0, 0);
                        CCAPI.Refresh();
                        TMAPI.BaseColor = Color.FromArgb(255, 0, 0);
                        Attached();
                    }
                    else
                    {
                        CCAPI.BaseColor = Color.FromArgb(192, 0, 0);
                        TMAPI.BaseColor = Color.FromArgb(192, 0, 0);
                        MessageBox.Show("Cannot Attach", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
                        StatusBar.Text = "Connected But Not Attached";
                    }
                }
                else
                {
                    CCAPI.BaseColor = Color.FromArgb(192, 0, 0);
                    TMAPI.BaseColor = Color.FromArgb(192, 0, 0);
                    MessageBox.Show("Cannot Connect", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
                    StatusBar.Text = "Cannot Connect";
                }
            }
            catch (Exception)
            {
                CCAPI.BaseColor = Color.FromArgb(192, 0, 0);
                TMAPI.BaseColor = Color.FromArgb(192, 0, 0);
                MessageBox.Show("Cannot Connect", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
                StatusBar.Text = "Cannot Connect";
            }
            finally
            {

            }
        }

