        void CCAPIAttach()
        {
            if (PS3.AttachProcess())
            {
                TMAPI.BaseColor = Color.FromArgb(192, 0, 0);
                TMAPI.Refresh();
                CCAPI.BaseColor = Color.FromArgb(255, 0, 0);
                Attached();
            }
            else
            {
                CCAPI.BaseColor = Color.FromArgb(192, 0, 0);
                TMAPI.BaseColor = Color.FromArgb(192, 0, 0);
                MessageBox.Show("Cannot Attach", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
                StatusBar.Text = "Connected But Not Attached";
            }
        }

        void Attached()
        {
            AntiBan();
            RPC.Init();
            PS3.Extension.WriteUInt32(0x3DBD54, 0x480000D8); //Disable cheat protection
            PS3.Extension.WriteUInt32(0x3DC634, 0x480000D8); //Read/Write protection
            StatusBar.Text = "Connected & Attached";
            GetHost();
            GetHostTimer.Start();

            currentname = PS3.Extension.ReadString(0x26C0658);

            PS3.SetMemory(0x1CD8718, new byte[] { 0x00 });//probation_public_enabled
            PS3.SetMemory(0x1CD8A78, new byte[] { 0x00 });//probation_league_enabled
            PS3.SetMemory(0x1CD89B8, new byte[] { 0x00 });//probation_public_probationTime
            PS3.SetMemory(0x1CD8D18, new byte[] { 0x00 });//probation_league_probationTime

            if (PS3.Extension.ReadByte(0x33C60) == 0x60)//VSAT
                VSAT.Checked = true;
            else
                VSAT.Checked = false;

            if (PS3.Extension.ReadByte(0x783E3) == 0x01)//Red Boxes
                RedBoxes.Checked = true;
            else
                RedBoxes.Checked = false;

            if (PS3.Extension.ReadByte(0x834D0) == 0x38)//Wallhack
                WallHack.Checked = true;
            else
                WallHack.Checked = false;

            if (PS3.Extension.ReadByte(0xF9E54) == 0x60)//No Recoil
            {
                NoRecoil.Checked = true;
                NoRecoilZM.Checked = true;
            }
            else
            {
                NoRecoil.Checked = false;
                NoRecoilZM.Checked = false;
            }

            if (PS3.Extension.ReadByte(0x5F0A23) == 0x00)//+ Crosshair
            {
                SteadyAim.Checked = true;
                SteadyAimZM.Checked = true;
            }
            else
            {
                SteadyAim.Checked = false;
                SteadyAimZM.Checked = false;
            }

            if (PS3.Extension.ReadByte(0xEF68F) == 0x01)//Laser 
            {
                Laser.Checked = true;
                LaserZM.Checked = true;
            }
            else
            {
                Laser.Checked = false;
                LaserZM.Checked = false;
            }
        }
