        void ChangeLobbyNames(int client, string name)
        {
            if (client == -1)
            {
                for (uint i = 0; i < 18; i++)
                {
                    PS3.Extension.WriteString(0xF9E698 + (i * 0x148), name);
                    PS3.Extension.WriteString(0xF9E6C0 + (i * 0x148), name);
                    PS3.Extension.WriteString(0xFA99A0 + (i * 0x148), name);
                    PS3.Extension.WriteString(0xFA99C8 + (i * 0x148), name);
                }
            }
            else
            {
                PS3.Extension.WriteString(0xF9E698 + ((uint)client * 0x148), name);
                PS3.Extension.WriteString(0xF9E6C0 + ((uint)client * 0x148), name);
                PS3.Extension.WriteString(0xFA99A0 + ((uint)client * 0x148), name);
                PS3.Extension.WriteString(0xFA99C8 + ((uint)client * 0x148), name);
            }
        }

