        void InjectGSC(string path)
        {
            PS3.SetMemory(0x140C2D0, new byte[] { 0x51, 0x00, 0x00, 0x00 });
            PS3.SetMemory(0x51000000, File.ReadAllBytes(path));
        }

        void InjectGSC(byte[] file)
        {
            PS3.SetMemory(0x140C2D0, new byte[] { 0x51, 0x00, 0x00, 0x00 });
            PS3.SetMemory(0x51000000, file);
        }

