        private async void HideLocalIP_CheckedChanged(object sender)
        {
            uint offset = 0x00;
            HideLocalIP.Checked = !HideLocalIP.Checked;
            HideLocalIP.Refresh();
            HideLocalIPLabel.Text = "Please Wait";
            HideLocalIPLabel.Refresh();
            await Task.Delay(1);
            string oip = Web.DownloadString("http://ipinfo.io/ip");
            byte[] hexip = new byte[4];
            for (int i = 0; i < 4; i++)
            {
                int[] ip = oip.Split('.').Select(x => int.Parse(x)).ToArray();
                hexip[i] = (byte)ip[i];
            }
            if (!HideLocalIP.Checked)
            {
                offset = (uint)Search(hexip, 0x1A30000, 0x10000, 4);
                if (offset != 0)
                {
                    Clipboard.SetText(offset.ToString("X"));
                    PS3.SetMemory(offset, customip);
                    MessageBox.Show("This must be enabled before joining a session for it to work. It can sometimes cause issues with joining friends. To reset IP turn off hide IP and exit to main menu, also this will not work for network sniffers", "Success", MessageBoxButtons.OK, MessageBoxIcon.Information);
                }
                else
                {
                    offset = (uint)Search(hexip, 0x1A20000, 0x100000, 4);
                    if (offset != 0)
                    {
                        Clipboard.SetText(offset.ToString("X"));
                        PS3.SetMemory(offset, customip);
                        MessageBox.Show("This must be enabled before joining a session for it to work. It can sometimes cause issues with joining friends. To reset IP turn off hide IP and exit to main menu, also this will not work for network sniffers", "Success", MessageBoxButtons.OK, MessageBoxIcon.Information);
                    }
                    else
                    {
                        MessageBox.Show("Cannot find offset", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
                    }
                }
            }
            else
            {
                offset = (uint)Search(customip, 0x1A30000, 0x10000, 4);
                if (offset != 0)
                {
                    PS3.SetMemory(offset, hexip);
                }
                else
                {
                    offset = (uint)Search(customip, 0x1A20000, 0x100000, 4);
                    if (offset != 0)
                    {
                        PS3.SetMemory(offset, hexip);
                    }
                    else
                    {
                        MessageBox.Show("Cannot find offset", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
                    }
                }
            }
            HideLocalIPLabel.Text = "Hide IP";
            HideLocalIPLabel.Refresh();
            HideLocalIP.Checked = !HideLocalIP.Checked;
            HideLocalIP.Refresh();
        }
