        private void GunX_Scroll(object sender)
        {
            if (GunX.Value < 50)
            {
                PS3.Extension.WriteInt32(0x01CCD6D8, (50 - GunX.Value) * 0x1DFFFF + 0x3C000000);
            }
            else if (GunX.Value > 50)
            {
                PS3.Extension.WriteInt64(0x01CCD6D4, GunX.Value * 0xDFFFF + 0xBC000000);
            }
            else
            {
                PS3.SetMemory(0x01CCD6D8, new byte[] { 0x00, 0x00, 0x00, 0x00 });
            }
        }

