        public string GetNames(int client)
        {
            string name = PS3.Extension.ReadString(0x178646C + (0x5808 * (uint)client));
            if (!string.IsNullOrEmpty(cellvalue[client]) && name.EndsWith(cellvalue[client]))
            {
                return cellvalue[client];
            }
            else
            {
                return name;
            }
        }


        private void ClientGrid_CellEndEdit(object sender, DataGridViewCellEventArgs e)
        {
            if (e.ColumnIndex == 2)
            {
                ClientNamesTimer.Start();
            }
            else
            {
                if (ClientGrid.CurrentRow.Index == 18)
                {
                    if (!string.IsNullOrEmpty(ClientGrid.Rows[18].Cells[1].Value.ToString()))
                    {
                        for (int i = 0; i < 18; i++)
                        {
                            PS3.Extension.WriteString(0x178646C + (0x5808 * (uint)i), ClientGrid.Rows[18].Cells[1].Value.ToString() + "\0");
                        }
                    }
                    else
                    {
                        ClientGrid[1, 18].Value = " ";
                    }
                }
                else
                {
                    if (!string.IsNullOrEmpty(ClientGrid.Rows[e.RowIndex].Cells[1].Value?.ToString()))
                    {
                        cellvalue[e.RowIndex] = ClientGrid.Rows[e.RowIndex].Cells[1].Value?.ToString();
                        PS3.Extension.WriteString(0x178646C + (0x5808 * (uint)e.RowIndex), ClientGrid.Rows[e.RowIndex].Cells[1].Value.ToString() + "\0");
                    }
                }
            }
        }

        private void ClientGrid_CellMouseUp(object sender, DataGridViewCellMouseEventArgs e)
        {
            if (e.ColumnIndex == 2)
            {
                ClientGrid.EndEdit();
            }
        }

        private void ClientNamesTimer_Tick(object sender, EventArgs e)
        {
            int stop = 0;
            if (ClientGrid.Rows[18].Cells[2].Value != null && (bool)ClientGrid.Rows[18].Cells[2].Value == true)
            {
                for (int i = 0; i < 18; i++)
                {
                    if (ClientGrid.Rows[i].Cells[2].Value == null || (bool)ClientGrid.Rows[i].Cells[2].Value == false)
                    {
                        PS3.Extension.WriteString(0x178646C + (0x5808 * (uint)i), "^" + Random.Next(1, 7).ToString() + ClientGrid.Rows[18].Cells[1].Value?.ToString() + "\0");
                        cellvalue[i] = ClientGrid.Rows[18].Cells[1].Value?.ToString();
                        stop++;
                    }
                    else
                    {
                        stop++;
                        if (!string.IsNullOrEmpty(ClientGrid.Rows[i].Cells[1].Value?.ToString()))
                        {
                            PS3.Extension.WriteString(0x178646C + (0x5808 * (uint)i), "^" + Random.Next(1, 7).ToString() + ClientGrid.Rows[i].Cells[1].Value.ToString() + "\0");
                            cellvalue[i] = ClientGrid.Rows[i].Cells[1].Value.ToString();
                        }
                    }
                }
            }
            else
            {
                for (int i = 0; i < 18; i++)
                {
                    if (ClientGrid.Rows[i].Cells[2].Value != null && (bool)ClientGrid.Rows[i].Cells[2].Value == true)
                    {
                        stop++;
                        if (!string.IsNullOrEmpty(ClientGrid.Rows[i].Cells[1].Value?.ToString()))
                        {
                            PS3.Extension.WriteString(0x178646C + (0x5808 * (uint)i), "^" + Random.Next(1, 7).ToString() + cellvalue[i] + "\0");
                            cellvalue[i] = ClientGrid.Rows[i].Cells[1].Value?.ToString();
                        }
                    }
                }
            }
            if (stop == 0)
            {
                ClientNamesTimer.Stop();
            }
        }

