        void ChangeName(string name, bool sticky = true, bool icon = false)
        {
            currentname = name;
            ChangeNameInGame();
            byte sizex = 0;
            byte sizey = 0;
            byte[] output;
            if (icon)
            {
                if (IconNameX.Value < 0)
                    if (IconNameX.Value > -0x10)
                        sizex = (byte)(IconNameX.Value + 0x0F);
                    else
                        sizex = (byte)(IconNameX.Value + 0xFF + 0x10);
                else
                    sizex = (byte)(IconNameX.Value + 0x10);


                if (IconNameY.Value < 0)
                    if (IconNameY.Value > -0x10)
                        sizey = (byte)(IconNameY.Value + 0x0F);
                    else
                        sizey = (byte)(IconNameY.Value + 0xFF + 0x10);
                else
                    sizey = (byte)(IconNameY.Value + 0x10);

                output = Encoding.ASCII.GetBytes("^H" + Encoding.ASCII.GetString(new byte[] { (byte)name.Length }) + name + "\0");
                output[2] = sizex;
                output[3] = sizey;
                Clipboard.SetText(Encoding.ASCII.GetString(output));
            }
            else
            {
                output = Encoding.ASCII.GetBytes(name + "\0");
            }

            PS3.SetMemory(0x26C0658, output);

            if (sticky)
            {
                PS3.SetMemory(0x26C067F, output);
            }
            else
            {
                PS3.Extension.WriteString(0x26C067F, PS3.Extension.ReadString(0x196E070) + "\0");
            }
        }

        string currentclan;
        void ChangeClan(string clan)
        {
            currentclan = clan;
            PS3.SetMemory(0x2708238, BitConverter.GetBytes(BitConverter.ToUInt64(Combine(new byte[8 - clan.Length], Encoding.ASCII.GetBytes(clan).Reverse().ToArray()).Reverse().ToArray(), 0) * 64));
            ChangeNameInGame();
        }

        private byte[] Combine(byte[] Arr1, byte[] Arr2)
        {
            byte[] Res = new byte[Arr1.Length + Arr2.Length];
            Buffer.BlockCopy(Arr1, 0, Res, 0, Arr1.Length);
            Buffer.BlockCopy(Arr2, 0, Res, Arr1.Length, Arr2.Length);
            return Res;
        }

        void ChangeNameInGame()
        {
            RPC.Cbuf_AddText(";cmd userinfo \"\\clanAbbrev\\" + currentclan + "\\name\\" + currentname.Replace(' ', '-'));
        }

