        void GrabIPs()
        {
            string[] partyid = new string[18];
            for (uint i = 0; i < 18; i++)
            {
                int num;
                string tempname = PS3.Extension.ReadString(0xF9E698 + (i * 0x148));
                byte[] ipbytes = PS3.GetBytes(0xF9E726 + (i * 0x148), 4);
                string tempip = ipbytes[0].ToString() + "." + ipbytes[1].ToString() + "." + ipbytes[2].ToString() + "." + ipbytes[3].ToString();
                if (string.IsNullOrEmpty(tempname) || tempip == "0.0.0.0")
                {
                    tempname = PS3.Extension.ReadString(0xFA99A0 + (i * 0x148));
                    ipbytes = PS3.GetBytes(0xFA9A2E + (i * 0x148), 4);
                    tempip = ipbytes[0].ToString() + "." + ipbytes[1].ToString() + "." + ipbytes[2].ToString() + "." + ipbytes[3].ToString();
                }
                if (!string.IsNullOrEmpty(tempname) && tempip != "0.0.0.0")
                {
                    partyid[i] = BitConverter.ToString(PS3.Extension.ReadBytes(0xF9E734 + i * 328, 8)).Replace("-", "");
                    if (!name.Contains(tempname))
                    {
                        name.Add(tempname);
                        ip.Add(tempip);
                        string[] geo = Web.DownloadString("http://ip-api.com/line/" + tempip).Split('\n');
                        if (geo[0] == "success")
                        {
                            ipinfo1.Add(geo[1]);
                            ipinfo2.Add(geo[4]);
                            ipinfo3.Add(geo[5]);
                            ipinfo4.Add(geo[11]);
                        }
                        else
                        {
                            ipinfo1.Add("");
                            ipinfo2.Add("");
                            ipinfo3.Add("");
                            ipinfo4.Add("");
                        }
                    }
                    num = name.IndexOf(tempname);
                    ip[num] = tempip;
                    Regex Regex1 = new Regex("^[a-zA-Z0-9_-]*$");
                    Regex Regex2 = new Regex("^[a-zA-Z]*$");
                    if (!name[num].EndsWith("(2)") && (name[num].Length > 16 || name[num].Length < 3 || !Regex1.IsMatch(name[num]) || !Regex2.IsMatch(name[num].Substring(0, 1))))
                        IPGrid[1, (int)i].Value = name[num] + " ?";
                    else
                        IPGrid[1, (int)i].Value = name[num];
                    string[] IP = ip[num].Split('.');
                    IPGrid[2, (int)i].Value = IP[0] + "." + IP[1] + "." + IP[2] + "." + "XXX".Substring(0, IP[3].Length);
                    IPGrid[3, (int)i].Value = ipinfo1[num];
                    IPGrid[4, (int)i].Value = ipinfo2[num];
                    IPGrid[5, (int)i].Value = ipinfo3[num];
                    IPGrid[6, (int)i].Value = ipinfo4[num];
                }
                else
                {
                    IPGrid[1, (int)i].Value = "";
                    IPGrid[2, (int)i].Value = "";
                    IPGrid[3, (int)i].Value = "";
                    IPGrid[4, (int)i].Value = "";
                    IPGrid[5, (int)i].Value = "";
                    IPGrid[6, (int)i].Value = "";
