            ofd.Multiselect = true;
            if (ofd.ShowDialog() == DialogResult.OK)
            {
                uint i = 0;
                uint offset = 0x51000000;
                foreach (string file in ofd.FileNames)
                {
                    PS3.Extension.WriteUInt32(0x140C2D0 + 0xC0 * i, offset );
                    string path = ofd.InitialDirectory + ofd.FileName;
                    byte[] files = File.ReadAllBytes(path);
                    PS3.SetMemory(offset, files);
                    MessageBox.Show("0x" + offset.ToString("X"));
                    offset += (uint)files.Length + 2;
                    i++;
                }
            }
        }

