        int bounce = 0;
        private void BounceClanTimer_Tick(object sender, EventArgs e)
        {
            if(bounce == 0)
            {
                ChangeClan("o...");
                bounce++;
            }
            else if (bounce == 1)
            {
                ChangeClan(".o..");
                bounce++;
            }
            else if (bounce == 2)
            {
                ChangeClan("..o.");
                bounce++;
            }
            else if (bounce == 3)
            {
                ChangeClan("...o");
                bounce++;
            }
            else if (bounce == 4)
            {
                ChangeClan("..o.");
                bounce++;
            }
            else if (bounce == 5)
            {
                ChangeClan(".o..");
                bounce = 0;
            }
        }

