        private void SetClassName(uint classnum, string name)
        {
            byte[] input = Encoding.ASCII.GetBytes(name);
            byte[] output = new byte[16];
            for (int i = 0; i < input.Length; ++i)
            {
                if (input[i] > 63 && i < 15)
                    output[i + 1] = 1;
                output[i] += (byte)(input[i] * 4);
            }
            PS3.SetMemory(0x2707AC7 + classnum * 16, output);
        }

