        private unsafe void SaveScreenshot_Click(object sender, EventArgs e)
        {
            uint offset = 0;
            int height = PS3.Extension.ReadInt16(0xD933D6);
            if (height == 1080 || height == 720)
            {
                if (MessageBox.Show("Are you sure? If using TMAPI your game will freeze for about 30 seconds and if in a match you will lag out, if using CCAPI the screenshot wont work properly", "", MessageBoxButtons.YesNo, MessageBoxIcon.Exclamation) != DialogResult.Yes)
                    return;
                if (height == 1080)
                    offset = 0xC26E0000;
                else if (height == 720)
                    offset = 0xC28D0000;
                PS3TMAPI.ProcessAttach(0, PS3TMAPI.UnitType.PPU, PS3Lib.TMAPI.Parameters.ProcessID);
                byte[] bytes = PS3.GetBytes(offset, 1280 * height * 4);
                PS3TMAPI.ProcessContinue(0, PS3Lib.TMAPI.Parameters.ProcessID);
                Bitmap bitmap = new Bitmap(1280, height);
                BitmapData bitmapdata = bitmap.LockBits(new Rectangle(0, 0, bitmap.Width, bitmap.Height), ImageLockMode.ReadWrite, PixelFormat.Format24bppRgb);
                byte* scan0 = (byte*)(void*)bitmapdata.Scan0;
                for (int collumn = 0; collumn < height; ++collumn)
                {
                    for (int row = 0; row < 1280; ++row)
                    {
                        scan0[row * 3 + collumn * bitmapdata.Stride] = bytes[collumn * 1280 * 4 + row * 4 + 3];
                        scan0[row * 3 + collumn * bitmapdata.Stride + 1] = bytes[collumn * 1280 * 4 + row * 4 + 2];
                        scan0[row * 3 + collumn * bitmapdata.Stride + 2] = bytes[collumn * 1280 * 4 + row * 4 + 1];
                    }
                }
                string folder = Environment.GetFolderPath(Environment.SpecialFolder.MyPictures) + "/PS3/BO2/";
                string file = DateTime.Now.ToShortDateString().Replace('/', '-') + "_" + DateTime.Now.ToShortTimeString().Replace(':', '-') + "-" + DateTime.Now.Second + ".bmp";
                    Directory.CreateDirectory(folder);
                bitmap.UnlockBits(bitmapdata);
                bitmap.Save(folder + file);
                Process.Start(folder + file);
            }
            else if (height == 576)
            {
                MessageBox.Show("You must be using 1080p or 720p", "Error", MessageBoxButtons.OK, MessageBoxIcon.Hand);
            }
            else
            {
                MessageBox.Show("You must be attached", "Error", MessageBoxButtons.OK, MessageBoxIcon.Hand);
            }
        }

