        private void Test_Click_1(object sender, EventArgs e)
        {
            byte[] kkkfc = GetWeaponKillBytes((int)TestNum.Value);
            MessageBox.Show(kkkfc[0].ToString("X2") + kkkfc[1].ToString("X2") + kkkfc[2].ToString("X2") + kkkfc[3].ToString("X2") + kkkfc[4].ToString("X2"));
            PS3.SetMemory(0x6969, GetWeaponKillBytes((int)TestNum.Value));
        }
        
        byte[] GetWeaponKillBytes(int kills)
        {
            byte[] returnKills = new byte[5];
            int bytenum = 9;
            for(int i = 29; i > 0; i-= 4)
            {
                int pow = (int)Math.Pow(2, i);
                if (kills >= pow)
                {
                    returnKills[bytenum / 2] += (byte)(kills / pow * (bytenum % 2 == 1 ? 0x10 : 0x1));
                    kills -= kills / pow * pow;
                }
                bytenum--;
            }
            returnKills[0] = kills % 2 == 1 ? (byte)0x8C : (byte)0x00;
            return returnKills;
        }
    } 
